        <title>KLCiS - Philippines IPTV Streaming</title>
        <style>
            body {
                margin: 0;
                font-family: Arial, sans-serif;
                overflow: hidden;
                background-color: #263238;
            }

            #player-container {
                position: relative;
                width: 100%;
                height: 100vh;
            }

            #video {
                width: 100%;
                height: 100%;
            }

            #channels-menu {
                position: absolute;
                top: 0;
                left: 0;
                background-color: rgba(255, 255, 255, 0.8);
                padding: 10px;
                border-radius: 5px;
                z-index: 1;
                display: none;
                max-height: calc(100vh - 20px);
                overflow-y: auto;
                transition: opacity 0.3s ease;
                opacity: 0;
            }

            #channels-menu.show {
                display: block;
                opacity: 1;
            }

            #channels-menu ul {
                list-style: none;
                padding: 0;
                margin: 0;
            }

            #channels-menu li {
                margin-bottom: 5px;
                display: flex;
                align-items: center;
                cursor: pointer;
                padding: 5px;
                border-radius: 5px;
                transition: background-color 0.3s;
            }

            #channels-menu li:hover {
                background-color: rgba(0, 0, 0, 0.1);
            }

            #channels-menu li.active {
                background-color: rgba(0, 0, 0, 0.2);
            }

            .channel-logo {
                width: 30px;
                height: 30px;
                margin-right: 10px;
                border-radius: 50%;
            }

            .channel-name {
                overflow: hidden;
                white-space: nowrap;
                text-overflow: ellipsis;
            }

            #menu-btn {
                position: absolute;
                top: 10px;
                left: 10px;
                z-index: 2;
                cursor: pointer;
                font-size: 25px;
                color: #FFFFFF;
            }

            #quality-btn {
                position: absolute;
                top: 10px;
                right: 15px;
                z-index: 2;
                cursor: pointer;
                font-size: 25px;
                color: #FFFFFF;
            }

            #quality-menu {
                position: absolute;
                top: 50px;
                right: 10px;
                background-color: rgba(255, 255, 255, 0.3);
                padding: 10px;
                border-radius: 5px;
                z-index: 2;
                display: none;
                cursor: pointer;
            }

            #quality-menu.show {
                display: block;
            }

            #info-text {
                position: absolute;
                bottom: 35%;
                left: 50%;
                transform: translateX(-50%);
                background-color: rgba(0, 0, 0, 0.7);
                color: #fff;
                padding: 10px;
                border-radius: 5px;
                z-index: 3;
                display: none;
                text-align: center;
            }
        </style>
